import logo from './logo.svg';
import './App.css';
import axios from "axios";

function App() {
  let courses = [];  
  axios.get('http://localhost:5000/api/courses')
    .then((response) => {
      courses = response.data;
    }
  );
  return (
    <div>
      courses
    </div>
  );
}

export default App;
